import React from 'react';
import Layout from '../components/Layout/Layout';

const About = () => {
    return (
        <Layout>
            <div className="about-container">
                <h1>About Our School</h1>
                <p>Welcome to our school! We are dedicated to providing a high-quality education to our students.</p>
                <h2>Our Mission</h2>
                <p>Our mission is to foster a nurturing environment that encourages academic excellence and personal growth.</p>
                <h2>Our Values</h2>
                <ul>
                    <li>Integrity</li>
                    <li>Respect</li>
                    <li>Collaboration</li>
                    <li>Innovation</li>
                </ul>
                <h2>Join Us</h2>
                <p>We invite you to learn more about our programs and become a part of our community!</p>
            </div>
        </Layout>
    );
};

export default About;
